<template>
  <ul class="sideBar flex flex-column animated fadeIn" v-show="sideShow">
    <li v-for="(item,i) in navList" :key="i">
      <div class="icon" @mouseenter='item.tipShow = true' @mouseleave='item.tipShow = false' @click="handleClick(item)">
        <img :src="item.tipShow?item.icon_active:item.icon" alt="">
        <p>{{item.text}}</p>
        <span class="badge" v-if='item.count'>{{item.count}}</span>
      </div>
      <div class="tipContainer" :style="item.position" @mouseenter='item.tipShow = true'
        @mouseleave='item.tipShow = false'>
        <transition name="custom-classes-transition" enter-active-class="animated bounceIn"
          leave-active-class="animated bounceOut">
          <div class="tipCon flex flex-c" v-if="item.tipShow&&item.tip" @click="handleClick(item)">
            <div class="tipText" v-show="item.tipText">
              <p style="width:140px;margin:5px 0;text-align:left;line-height:24px;" v-for="(i,d) in item.tipText"
                :key="d">{{ i }}</p>
            </div>
            <div class="tipImg" v-show="item.tipImg.length!=0" v-for="(o,n) in item.tipImg" :key="n">
              <img :src="o.img" alt="">
              <p>{{o.text}}</p>
            </div>
          </div>
        </transition>
      </div>
    </li>
  </ul>
</template>

<script>
import { API } from "~/_config/API.js";
export default {
  props: {
    cartL: {
      type: Number,
      default: 0
    }
  },
  data() {
    return {
      sideShow: true,
      navList: [
        {
          tip: false,
          icon: "img/icon-user.png",
          icon_active: "img/icon-user-active.png",
          text: "我的云仓",
          tipImg: [],
          tipText: null,
          link: "/dashboard",
          tipShow: false,
          handleEvent: "link"
        },
        {
          tip: false,
          icon: "img/icon-shopcar.png",
          icon_active: "img/icon-shopcar-active.png",
          text: "购物车",
          count: 0,
          tipImg: [],
          tipText: null,
          link: "/car",
          tipShow: false,
          handleEvent: "link"
        },
        {
          tip: true,
          icon: "img/icon-message.png",
          icon_active: "img/icon-message-active.png",
          text: "联系客服",
          tipImg: [
            {
              img:
                "data:image/jpeg;base64,",
              text: "客服微信"
            },
            { img: "img/kefu.jpg", text: "客服QQ" }
          ],
          tipText: null,
          open: "",
          tipShow: false,
          handleEvent: "open"
        },
        {
          tip: true,
          icon: "img/icon-phone.png",
          icon_active: "img/icon-phone-active.png",
          text: "客服电话",
          tipImg: [],
          tipText: [],
          tipShow: false,
          handleEvent: "",
          position: {
            top: "10px"
          }
        },
        {
          tip: true,
          icon: "img/icon-erweima.png",
          icon_active: "img/icon-erweima-active.png",
          text: "扫一扫",
          tipImg: [
            { img: "img/xiaochengxu.jpg", text: "小程序" },
            { img: "img/qrcode.jpg", text: "公众号" }
          ],
          tipShow: false,
          handleEvent: "",
          position: {
            top: "-20px"
          }
        },
        {
          tip: false,
          icon: "img/icon-xiangshang.png",
          icon_active: "img/icon-xiangshang-active.png",
          text: "返回顶部",
          tipImg: [],
          tipText: null,
          tipShow: false,
          handleEvent: "toTop"
        }
      ]
    };
  },
  computed: {
    shocarLen() {
      return this.$store.getters["shopcarStatus/len"];
    }
  },
  methods: {
    handleClick(item) {
      if (item.handleEvent == "link") {
        let { href } = this.$router.resolve({ path: item.link });
        window.open(href, "_blank");
      } else if (item.handleEvent == "open") {
        let u =
          "https://chat.xiankefu.com/?bid=8c827410baf6caf4c810e9b9bce25f9a";
        window.open(u);
      } else if (item.handleEvent == "toTop") {
        (function smoothscroll() {
          let currentScroll =
            document.documentElement.scrollTop || document.body.scrollTop;
          if (currentScroll > 0) {
            window.requestAnimationFrame(smoothscroll);
            window.scrollTo(0, currentScroll - currentScroll / 5);
          }
        })();
      }
    },
    sideBarShow() {
      let currentScroll =
        document.documentElement.scrollTop || document.body.scrollTop;
      if (currentScroll > 20) {
        this.sideShow = true;
      } else {
        this.sideShow = false;
      }
    },
    getPhone() {
      API.serverPhone({
        token: localStorage.getItem("user")
          ? JSON.parse(localStorage.getItem("user")).token
          : null
      }).then(res => {
        if (res.ResponseId == 0) {
          let data = res.Data;
          this.navList[2].open = data.CustomerNumber;
          this.navList[3].tipText = data.Phone.split(",");
        }
      });
    }
  },
  mounted() {
    this.getPhone();
    if (localStorage.getItem("user"))
      this.$store.dispatch(
        "shopcarStatus/GETCARLEN",
        localStorage.getItem("user")
          ? JSON.parse(localStorage.getItem("user")).token
          : null
      );
  },
  watch: {
    shocarLen: function(val) {
      this.navList[1].count = val;
      this.$forceUpdate();
    }
  }
};
</script>

